import React from 'react';
import './FoodMenuBar.css'; // Import the CSS file

const foodItems = [
  {
    name: 'Pasta',
    image: 'https://www.example.com/pasta-image.jpg', // Replace with actual image URL
    price: 10.99,
  },
  {
    name: 'Burger',
    image: 'https://www.example.com/burger-image.jpg', // Replace with actual image URL
    price: 8.49,
  },
  {
    name: 'Pizza',
    image: 'https://www.example.com/pizza-image.jpg', // Replace with actual image URL
    price: 12.99,
  },
  // Add more food items as needed
];

const FoodMenuBar = () => {
  return (
    <div className="food-menu-bar">
      <div className="food-menu-title">
        <h2>Food Menu</h2>
      </div>
      <div className="food-items">
        {foodItems.map((food, index) => (
          <div className="food-item" key={index}>
            <img src={food.image} alt={food.name} />
            <h3>{food.name}</h3>
            <p className="food-price">${food.price.toFixed(2)}</p>
            <button className="select-button">Select</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FoodMenuBar;
